import './App.css';

function App() {
  return (
    <div className="App">
      <div className="Body">
        <h1>TODO</h1>
        <hr className="Main-line"/>
        <div className="Tasks">
          <div className="Tasks__item"><span>08:00</span> Smoking all night</div>
          <div className="Tasks__item"><span>09:00</span> Lorem, ipsum dolor</div>
          <div className="Tasks__item"><span>10:00</span> Sit amet consectetur</div>
          <div className="Tasks__item"><span>15:30</span> Eat meat with juice</div>
          <div className="Tasks__item"><span>16:00</span> Aboba ebat rot</div>
        </div>
      </div>
    </div>
  );
}

export default App;
